import React from "react";
import {
  BrowserRouter,
  Routes,
  Route,
  NavLink,
  useNavigate,
} from "react-router-dom";
import WritingPage from "./WritingPage";
import DiaryPage from "./DiaryPage";
import LoginPage from "./LoginPage";
import SignUpPage from "./SignUpPage";
import { AuthProvider, useAuth } from "./AuthContext";
import "./App.css";

// Using placeholder images for now
const logoBackground =
  "data:image/svg+xml;base64,";
const moodMuseLogo =
  "data:image/svg+xml;base64,";

function AppContent() {
  const navigate = useNavigate();
  const { user, isAuthenticated, logout } = useAuth();

  const handleLogin = () => navigate("/login");
  const handleSignup = () => navigate("/signup");
  const handleLogout = () => {
    logout();
    navigate("/");
  };

  return (
    <div
      className="App"
      style={{
        backgroundImage: `url(${logoBackground})`,
        backgroundSize: "cover",
        backgroundPosition: "center",
        minHeight: "100vh",
        color: "white",
      }}
    >
      <img src={moodMuseLogo} alt="MoodMuse Logo" className="logo" />

      <ul className="navbar">
        <li>
          <NavLink
            to="/writing"
            className={({ isActive }) => (isActive ? "active-link" : "")}
          >
            Writing
          </NavLink>
        </li>
        <li>
          <NavLink
            to="/diary"
            className={({ isActive }) => (isActive ? "active-link" : "")}
          >
            Diary
          </NavLink>
        </li>
      </ul>

      <div className="buttons">
        {isAuthenticated ? (
          <div className="user-section">
            <span className="welcome-user">
              Welcome, {user?.firstName || user?.name}!
            </span>
            <button className="logout-button" onClick={handleLogout}>
              Log Out
            </button>
          </div>
        ) : (
          <>
            <button className="newbutton" onClick={handleLogin}>
              Log In
            </button>
            <button className="signup" onClick={handleSignup}>
              Sign Up
            </button>
          </>
        )}
      </div>

      <Routes>
        <Route path="/writing" element={<WritingPage />} />
        <Route path="/diary" element={<DiaryPage />} />
        <Route
          path="/"
          element={
            <div className="welcome">
              <h1>
                {isAuthenticated
                  ? `Welcome back, ${user?.firstName || user?.name}!`
                  : "Welcome back!"}
              </h1>
              <p>How are you feeling today?</p>
              <div className="mood-buttons">
                <button className="happy">üòä Happy</button>
                <button className="meh">üòê Meh</button>
                <button className="sad">üò¢ Sad</button>
              </div>
            </div>
          }
        />
      </Routes>
    </div>
  );
}

function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
        <Routes>
          <Route path="/login" element={<LoginPage />} />
          <Route path="/signup" element={<SignUpPage />} />
          <Route path="/*" element={<AppContent />} />
        </Routes>
      </BrowserRouter>
    </AuthProvider>
  );
}

export default App;
